def on_b_pressed():
    pass
controller.B.on_event(ControllerButtonEvent.PRESSED, on_b_pressed)

def on_a_pressed():
    if mySprite.vy == 0:
        mySprite.vy = -150
controller.A.on_event(ControllerButtonEvent.PRESSED, on_a_pressed)

def on_overlap_tile(sprite, location):
    mySprite.ay = 50
    mySprite.vy = -5000
scene.on_overlap_tile(SpriteKind.player, myTiles.tile8, on_overlap_tile)

def on_overlap_tile2(sprite, location):
    mySprite.ay = 450
    mySprite.vy = -150
scene.on_overlap_tile(SpriteKind.player, myTiles.tile9, on_overlap_tile2)

def on_overlap_tile3(sprite, location):
    game.over(True, effects.confetti)
scene.on_overlap_tile(SpriteKind.player, myTiles.tile7, on_overlap_tile3)

def on_overlap_tile4(sprite, location):
    game.over(False, effects.melt)
scene.on_overlap_tile(SpriteKind.player, myTiles.tile6, on_overlap_tile4)

def on_on_overlap(sprite, otherSprite):
    Enemy1.destroy()
    if mySprite.x < Enemy1.y:
        info.change_score_by(1)
    else:
        info.change_life_by(-1)
sprites.on_overlap(SpriteKind.player, SpriteKind.enemy, on_on_overlap)

